import "./Dapp.css";
import styled from "styled-components";
import { Dapp } from "./components/Dapp";

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #0f0c0d;
`;

function App() {
  return (
    <AppContainer>
      <Dapp />
    </AppContainer>
  );
}

export default App;
